import {Button} from "@material-ui/core";
import React from "react";
import Typography from "@material-ui/core/Typography";
import CardContent from "@material-ui/core/CardContent";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import { useHistory } from "react-router-dom";
import PropTypes from "prop-types";

function JobsAdsCard({ ad }) {

    const history = useHistory();

    const handleGoBack = () => {
        history.push("/")
    }

    return (
        <>
            {/*<Button onClick={handleGoBack()}> Go back</Button>*/}
            <Card  variant="outlined">
                <CardContent>
                    <Typography  color="textSecondary" gutterBottom>
                        {ad.name}
                    </Typography>
                    <Typography variant="body2" component="p">
                       Miestas :  {ad.location}
                    </Typography>
                    <Typography variant="body2" component="p">
                        Atlyginimas i rankas eurais:  {ad.wage}
                    </Typography>
                    <Typography variant="body2" component="p">
                        Aprasymas : {ad.description} | {ad.company}
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button size="small">Sent CV</Button>
                </CardActions>
            </Card>
        </>
    )
}
JobsAdsCard.propTypes = {
        ad: PropTypes.shape({
            name: PropTypes.string.isRequired,
            description: PropTypes.string.isRequired,
            location: PropTypes.string.isRequired,
            company: PropTypes.number.isRequired
        })
}
        export default JobsAdsCard;
